function testName(name, msg) {
    const rex = new RegExp('(^|[^a-z])' + name + '($|[^a-z?])', 'g')
    return rex.test(msg);
}

function removePolishLetters(s) {
    s = s.replaceAll('ł', 'l');
    s = s.replaceAll('ę', 'e');
    s = s.replaceAll('ą', 'a');
    s = s.replaceAll('ó', 'o');
    s = s.replaceAll('ć', 'c');
    s = s.replaceAll('ś', 's');
    s = s.replaceAll('ń', 'n');
    s = s.replaceAll(/[żź]/g, 'z');
    return s;
}